var counter_total = 0
var x = 0
var y = 0

var lowresInterval = 0;
var midresInterval = 0;
var highressInterval = 0;

var drawHighres = function(){
  let rgb = 'rgb('+ highres[counter_total][0] +','+ highres[counter_total][1] +','+ highres[counter_total][2] +')';
  $('#selfie-canvas').drawRect({
    fillStyle: rgb,
    x: 3*x, y: 3*y,
    width: 3,
    height: 3,
    layer: true,
    groups: ['block']
    });
}


var drawMidres = function() {
  let rgb = 'rgb('+ midres[counter_total][0] +','+ midres[counter_total][1] +','+ midres[counter_total][2] +')';
  $('#selfie-canvas').drawRect({
    fillStyle: rgb,
    x: 6*x, y: 6*y,
    width: 6,
    height: 6,
    layer: true,
    groups: ['block']
    });
}

var drawLowres = function(){

  let rgb = 'rgb('+ lowres[counter_total][0] +','+ lowres[counter_total][1] +','+ lowres[counter_total][2] +')';
  $('#selfie-canvas').drawRect({
    fillStyle: rgb,
    x: 12*x, y: 12*y,
    width: 12,
    height: 12,
    layer: true,
    groups: ['block']
    });
}

var renderHighres = function(){
  if (counter_total > 2303){

    // remove first interval
    clearInterval(highressInterval);

    counter_total = 0
    x = 0
    y = 0

    return
  };

  drawHighres();

  counter_total ++;
  x++;

  if (counter_total % 48 === 0){
    x = 0
    y++;
  }
}

var renderMidres = function(){

  if (counter_total > 575){

    // remove first interval
    clearInterval(midresInterval);

    counter_total = 0
    x = 0
    y = 0

    // start rendering highress
    midresInterval = setInterval(renderHighres, 0.0001);

    return
  };

  drawMidres();

  counter_total ++;
  x++;

  if (counter_total % 24 === 0){
    x = 0
    y++;
  }
}


var renderLowres = function(){

  if (counter_total > 143){

    // remove first interval
    clearInterval(lowresInterval);

    counter_total = 0
    x = 0
    y = 0

    // start rendering midress
    midresInterval = setInterval(renderMidres, 1);

    return
  };

  drawLowres();

  counter_total ++;
  x++;

  if (counter_total % 12 === 0){
    x = 0
    y++;
  }
}


var render = function(){
  var counter_total = 0
  var x = 0
  var y = 0
  lowresInterval = setInterval(renderLowres, 2);
}

render();
